            <tr>
                <th>Type</th>
                <th>Amount</th>
                <th>Currency</th>
            </tr>
        </thead>

        <tbody>
        {transaction.map(element=> {
            <tr key={element.id}>
                <td>{element.type}</td>
                <td>{element.amount}</td>
                <td>{element.currency}</td>
            </tr> 
        })}
        </tbody>
    </table>
    );
}

export default TransactionHistory({transactions});
